import Link from 'next/link';

const Navbar = () => (

    <nav className="main-navbar">
        <div>
            <p>IMDB</p>
        </div>
        <div>
            <input type="text" placeholder="Search" />
        </div>
        <div>
            <p>Sign in</p>
        </div>
    </nav>

);

export default Navbar;
